script: |
  super -f text -I q5591.spq | sort > q5591.out

inputs:
  - name: q5591.spq
    data: |
      SELECT ALL - 53 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col0 * - col1 + - + col1 IS NULL OR NOT - col2 IS NOT NULL;
  - name: tab1

outputs:
  - name: q5591.out
    data: |
      -53
      -53
      -53
